c.
SELECT a.* FROM books AS a, (SELECT a.book_id FROM borrows AS a, readers AS b WHERE a.reader_id = b.id GROUP BY a.reader_id HAVING COUNT(DISTINCT a.book_id) >=2) AS c WHERE a.id = c.book_id;

d.
SELECT a.* FROM books AS a, borrows AS b, authors AS c WHERE a.id = b.book_id AND a.author_id = c.id AND YEAR(b.time_borrow) = 2011 AND c.name = 'Stephen King' GROUP BY a.id HAVING COUNT(a.id) = 0;

create table tblNhacsi (
id int(5) primary key auto_increment,
ten varchar(50),
tuoi int(5),
thongtin varchar(255)
);

create table tblCasi (
id int(5) primary key auto_increment,
ten varchar(50),
tuoi int(5),
thongtin varchar(255)
);

create table tblBaihat (
id int(5) primary key auto_increment,
ten varchar(50),
ngaysangtac date,
nhacsi_id int(5) references tblNhacsi(id),
);

create table tblQuanhe (
id int(5) primary key auto_increment,
casi_id int(5) references tblCasi(id),
baihat_id int(5) references tblBaihat(id)
);

1. Tìm các bài hát của Trịnh Công Sơn được Mỹ Linh hát

select tblBaihat.name from ((tblNhacsi inner join tblBaihat on tblNhacsi.id = tblBaihat.nhacsi_id) inner join tblQuanhe on tblBaihat.id = tblQuanhe.baihat_id) inner join tblCasi on tblCasi.id = tblQuanhe.casi_id where tblNhacsi.ten = "Trịnh Công Sơn" and tblCasi.ten = "Mỹ Linh" ;

2. Tìm các ca sĩ đã hát các bài hát của Trịnh Công Sơn trẻ hơn 30   tuổi, sắp xếp theo tên ca sĩ

select tblCasi.ten from ((tblNhacsi inenner join tblBaihat on tblNhacsi.id = tblBaihat.nhacsi_id) inner join tblQuanhe on tblBaihat.id = tblQuanhe.baihat_id) inner join tblCasi on tblCasi.id = tblQuanhe.casi_id where tblNhacsi.nghedanh = "Trịnh Công Sơn" and tblCasi.tuoi < 30 order by tblCasi.ten ASC;

create table tblStudent(
