);

create table tblClass(
id_class int(5) primary key auto_increment,
name_class varchar(50) not null,
id_Student int(5) references tblStudent(id_Student),
);

create table tblSubject(
id_Subject int(5) primary key auto_increment,
name_Subject varchar(50) not null,
);

create table tblRegister(
id_Register int(5) primary key auto_increment,
id_Student int(5) references tblStudent(id_Student),
id_Subject int(5) references tblSubject(id_Subject),
);

create table tblTeaching(
id_Teaching int(5) primary key auto_increment,
id_Teacher int(5) references tblTeacher(id_Teacher),
